import React from "react";
import "./index.css";
import bro from"./Used Images/bro.png";
import Ellipse from "./Used Images/Ellipse 190.png";

function HomePage() {
    return (<>

        <div className="position-relative home1">
            <center>

                <div class="position-relative  d-grid gap-2 col-7 mx-auto w-100">
                    <h3 className=""> Elevate <span class="fw-bold">Real Estate Success</span> with</h3>
                    <h3> Osumare's Digital Expertise</h3>
                    <p className="fs-5">Tailored Solutions for Thriving in the Digital Real Estate Landscape</p>

                    <button class="btn btn-primary d-grid gap-2 col-3 mx-auto rounded-pill" type="button">Get started</button>

                    <div class="container-fluid position-absolute col-5 end-0">
                        <img class="position-absolute end-0 col-7" src={Ellipse} />
                    </div>
                </div>
            </center>

            <div className="d-flex justify-content-center mt-5 home">
                <img src={bro}/>

            </div>

        </div>
    </>);
}
export default HomePage;
